import './App.css'
import NoteList from './components/NotesList/notelist'
import { H1VerticalLeft, H1VerticalRight } from './components/h1vertical'
function App() {
  return (
    <div className="flex flex justify-center items-center h-screen w-screen bg-dotted-spacing-10 bg-dotted-amber-500 bg-dotted-radius-0.5 bg-[#0A0A0A] ">
      <H1VerticalLeft side="left" text="Note Taker" reverse={true} />
      <NoteList />
      <H1VerticalRight side="right" text="Note Taker" />
    </div>
  )
}

export default App
